import React, { Component } from "react";
import "./MainLoader.css";

export default class MainLoader extends Component {
   render() {
      return (
         <div class="theme-loader" visible={this.props.visible}>
            <div class="loader-track">
               <div class="loader-bar" />
            </div>
         </div>
      );
   }
}
